// Input: { data: [...] } desde el nodo HTTP Request (GET https://openrouter.ai/api/v1/models)
const data = ($input.first()?.json?.data) ?? [];

// free = id termina en :free o precios 0
const isZero = v => v === 0 || v === "0" || v === "0.0" || v === "0.0000000";
const isFree = (m) => {
  const idFree = typeof m.id === 'string' && m.id.endsWith(':free');
  const p = m.pricing || {};
  const prompt = (p.prompt ?? '').toString();
  const completion = (p.completion ?? '').toString();
  const priceFree = isZero(prompt) && isZero(completion);
  return idFree || priceFree;
};

// formato legible (Europa/Madrid). La API suele dar segundos; si vienen ms, lo detectamos.
function humanDate(ts) {
  if (ts == null) return null;
  let n = Number(ts);
  if (!Number.isFinite(n)) return null;
  if (n < 1e12) n *= 1000; // segundos -> ms
  const d = new Date(n);
  if (isNaN(d.getTime())) return null;
  return new Intl.DateTimeFormat('es-ES', {
    timeZone: 'Europe/Madrid',
    year: 'numeric', month: '2-digit', day: '2-digit',
    hour: '2-digit', minute: '2-digit'
  }).format(d);
}

// 1) Limpia: solo modelos con id de tipo string (descarta id nulo/no-string)
// 2) Filtra: solo "free" por id o por precios a 0
// 3) Mapea: añade created/human
const out = (Array.isArray(data) ? data : [])
  .filter(m => m && typeof m.id === 'string')
  .filter(isFree)
  .map(m => {
    const created_unix = m.created ?? null;
    const created = humanDate(created_unix);
    return { json: { ...m, created, created_unix } };
  });

return out;

// Soporta dos casos:
// 1) Un solo item con { json: { data: [...] } }  (HTTP Request)
// 2) N items, uno por modelo (tu caso actual: 55 items)

const inItems = $input.all();

// utilidades
const isZero = v => v === 0 || v === "0" || v === "0.0" || v === "0.0000000";
const isFree = (m) => {
  const idFree = typeof m.id === 'string' && m.id.endsWith(':free');
  const p = m.pricing || {};
  const prompt = (p.prompt ?? '').toString();
  const completion = (p.completion ?? '').toString();
  const priceFree = isZero(prompt) && isZero(completion);
  return idFree || priceFree;
};

function humanDate(ts) {
  if (ts == null) return null;
  let n = Number(ts);
  if (!Number.isFinite(n)) return null;
  if (n < 1e12) n *= 1000; // segundos -> ms
  const d = new Date(n);
  if (isNaN(d.getTime())) return null;
  return new Intl.DateTimeFormat('es-ES', {
    timeZone: 'Europe/Madrid',
    year: 'numeric', month: '2-digit', day: '2-digit',
    hour: '2-digit', minute: '2-digit'
  }).format(d);
}

const toNum = (x) => {
  const n = Number(x);
  return Number.isFinite(n) ? n : null;
};
const toTextOrNull = (x) => (typeof x === 'string' && x.length ? x : null);

// Detecta modo entrada
const singleWithArray = inItems.length === 1 && Array.isArray(inItems[0]?.json?.data);

// Cuando llegan N items (55), mantenemos 1→1 y NO re-filtramos por "free" (ya viene filtrado aguas arriba).
// Cuando llega un único item con data[], sí aplicamos el filtro "free".
let models;
let applyFreeFilter;

if (singleWithArray) {
  models = inItems[0].json.data;
  applyFreeFilter = true;
} else {
  models = inItems.map(it => it.json);
  applyFreeFilter = false;
}

// Limpieza de ids y filtro opcional de "free"
let list = models.filter(m => m && typeof m.id === 'string' && m.id.trim() !== '');
if (applyFreeFilter) {
  list = list.filter(isFree);
}

// Salida uniforme para Supabase (mismas claves en todas las filas)
const out = list.map((m, i) => {
  const row = {
    model_id: m.id,
    name: toTextOrNull(m.name) ?? m.id,
    description: toTextOrNull(m.description),
    created: humanDate(m.created ?? null),
    created_unix: toNum(m.created),
    intelligence_score: toNum(m.intelligence_score),
    data: m,         // jsonb
    work: false
    // no mandes created_at/updated_at si tu tabla los pone por defecto
  };

  // conserva el pairing cuando entran N items (útil para depurar)
  const pairedItem = singleWithArray ? undefined : { item: i };
  return { json: row, pairedItem };
});

return out;
